➡️ 착용감후기
 🌱 우레탄트랙에서
1. 신발 처음 신기도하고, 적응차 및 몸풀이로 우레탄깔려있는 트랙에서 36초페이스 ~ 27초페이스로 포어풋으로 몸 풀었을때, 천천히 뛸 때는 통통 느낌은 살짝 있지만 밀어주는 느낌은 적음.
.
2. 24초페이스에 비해 21초 페이스로 포어풋으로 뛰니, 카본의 탄력성으로 밀어주는 느낌이 많이 있었음 . 😲
