.
 🌱로드에서
1. 25초~26초페이스의 속도로 포어풋으로 달렸는데, 카본의 탄력성이라든지, 밀어주는 느낌이 우레탄보다는 덜 느껴짐 
굽높은 신발의 빠른속도의 착지감의 불안정감은 조금 있었다
ㅡ
